const StatCard = ({ title, value, sub, green }) => {
  return (
    <div className="stat-card">
      <p className="stat-title">{title}</p>
      <h2>{value}</h2>
      {sub && (
        <span className={green ? "green-text" : "muted-text"}>
          {sub}
        </span>
      )}
    </div>
  );
};

export default StatCard;
